import React from 'react';
import { Link } from "react-router-dom";

class Register extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return(
            <section className="register">
                <form name="register" className="field__form">
                <p className="field__welcome">Регистрация</p>
                <input id="email" name="email"  placeholder="Email" className="field__input" required/>
                <input id="password" type="password" placeholder="Пароль" name="password" className="field__input" required />
                <button name="submit" className="field__submit" type="submit" aria-label="Зарегестрироваться">Зарегистрироваться</button>
                <p className="field__text">Уже зарегистрированы?<Link to="/sign-in" className="field__link">Войти </Link></p>
                </form>
            </section>
        )
    }
}

export default Register;
